import axios from "axios";
import * as constants from "./constants"
import { fromJS} from "immutable"

export const login = (account, password) => {
    return (dispatch) => { 
        axios.get("/api/login?account=" + account + "&password=" + password).then(res => {
            console.log()
        })
    
    }       
    
}
